# Auto-install required packages
REQUIRED_PACKAGES = [
    "playsound",
    "customtkinter",
    "watchdog",
    "python-osc",
    "requests"
]

def install_packages():
    for package in REQUIRED_PACKAGES:
        try:
            __import__(package)
        except ImportError:
            subprocess.check_call([sys.executable, "-m", "pip", "install", package])



install_packages()

GITHUB_USER = "1cd0"
GITHUB_REPO = "AquaV2"
GITHUB_RELEASE_URL = f"https://api.github.com/repos/{GITHUB_USER}/{GITHUB_REPO}/releases/latest"

CURRENT_VERSION = "1.0.1"


def check_for_updates():
    try:
        # Get the latest release information from GitHub
        response = requests.get(GITHUB_RELEASE_URL)
        response.raise_for_status()

        release_data = response.json()
        latest_version = release_data['tag_name']
        download_url = release_data['assets'][0]['browser_download_url']

        print(f"Latest version: {latest_version}")
        print(f"Current version: {CURRENT_VERSION}")

        # Compare the versions
        if latest_version > CURRENT_VERSION:
            print("New version available. Updating...")
            download_and_replace_script(download_url)
        else:
            print("You are using the latest version.")

    except requests.exceptions.RequestException as e:
        print(f"Error checking for updates: {e}")

# Download and replace the current script with the latest one
def download_and_replace_script(download_url):
    try:
        # Download the latest version of the script
        response = requests.get(download_url)
        response.raise_for_status()

        # Get the script filename (you can change this if needed)
        script_filename = os.path.basename(download_url)

        # Save the new script
        with open(script_filename, "wb") as file:
            file.write(response.content)

        print(f"Update downloaded. Replacing {script_filename}...")
        
        # Replace the old script (this will overwrite the existing script)
        os.replace(script_filename, sys.argv[0])  # Replace the current script with the new one

        print("Script updated successfully. Restarting...")
        os.execv(sys.argv[0], sys.argv)  # Restart the script with the new version

    except requests.exceptions.RequestException as e:
        print(f"Error downloading the update: {e}")


ICON_BASE64 = ""
DONE_WAV_BASE64 = ""

# Function to decode and save the base64 string as a file
def decode_base64_to_file(base64_string, output_path):
    with open(output_path, "wb") as file:
        file.write(base64.b64decode(base64_string))
    print(f"File saved as {output_path}")

# Ensure required files are present
def ensure_files_exist():
    script_dir = os.path.dirname(os.path.abspath(__file__))  # Get current script directory

    # Check if icon.ico exists, if not, decode and save it
    if not os.path.exists(os.path.join(script_dir, "icon.ico")):
        decode_base64_to_file(ICON_BASE64, os.path.join(script_dir, "icon.ico"))

    # Check if done.wav exists, if not, decode and save it
    if not os.path.exists(os.path.join(script_dir, "done.wav")):
        decode_base64_to_file(DONE_WAV_BASE64, os.path.join(script_dir, "done.wav"))

