ROOT_DIR = os.path.expandvars(r"%AppData%\..\LocalLow\VRChat\VRChat\Cache-WindowsPlayer")
SCRIPT_DIR = os.path.dirname(os.path.realpath(__file__))
OUTPUT_FILE = os.path.join(SCRIPT_DIR, "ids.txt")
SCANNED_FILE = os.path.join(SCRIPT_DIR, "logged.txt")
CONFIG_FILE = os.path.join(SCRIPT_DIR, "settings.ini")
DONE_SOUND = os.path.join(SCRIPT_DIR, "done.wav")
AVATAR_ID_PATTERN = re.compile(r'avtr_[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}')

extracted_ids = set()
auto_mode_running = False
auto_mode_thread = None

config = configparser.ConfigParser()
if not os.path.exists(CONFIG_FILE):
    config["SETTINGS"] = {
        "osc_enabled": "no",
        "threads": "6",
        "theme": "Dark"
    }
    with open(CONFIG_FILE, 'w') as config_file:
        config.write(config_file)
else:
    config.read(CONFIG_FILE)

osc_enabled = config.get("SETTINGS", "osc_enabled", fallback="yes").lower() == "yes"
selected_threads = int(config.get("SETTINGS", "threads", fallback="6"))
selected_theme = config.get("SETTINGS", "theme", fallback="Dark")

OSC_IP = "127.0.0.1"
OSC_PORT = 9000
osc_client = SimpleUDPClient(OSC_IP, OSC_PORT)

def save_config():
    config["SETTINGS"]["osc_enabled"] = "yes" if osc_enabled else "no"
    config["SETTINGS"]["threads"] = str(selected_threads)
    config["SETTINGS"]["theme"] = selected_theme
    with open(CONFIG_FILE, 'w') as config_file:
        config.write(config_file)

def write_to_output(section, content):
    with open(OUTPUT_FILE, 'a', encoding='utf-8') as f:
        if not os.path.exists(OUTPUT_FILE) or section not in open(OUTPUT_FILE, 'r', encoding='utf-8').read():
            f.write(f"------{section.upper()}------\n")
        f.write(content + "\n")

def save_scanned_directory(folder_name):
    with open(SCANNED_FILE, 'a', encoding='utf-8') as f:
        f.write(folder_name + "\n")


def is_scanned(folder_name):
    if not os.path.exists(SCANNED_FILE):
        return False
    with open(SCANNED_FILE, 'r', encoding='utf-8') as f:
        return folder_name in f.read().splitlines()


def send_osc_message(main_folder_name, avatar_id):
    if osc_enabled:
        message = f"Well hello  {avatar_id} |  {main_folder_name}"
        osc_client.send_message("/chatbox/input", [message, True, True])
        time.sleep(1)

def process_data_file(file_path, folder_name, debug_box):
    try:
        temp_txt_file = file_path + ".txt"
        shutil.copyfile(file_path, temp_txt_file)

        with open(temp_txt_file, 'r', encoding='utf-8', errors='ignore') as f:
            data = f.read()

        avatar_ids = AVATAR_ID_PATTERN.findall(data)

        if avatar_ids:
            new_ids = set(avatar_id for avatar_id in avatar_ids if avatar_id not in extracted_ids)
            for avatar_id in new_ids:
                extracted_ids.add(avatar_id)
                write_to_output("AVATAR", avatar_id)
                send_osc_message(folder_name, avatar_id)

        os.remove(temp_txt_file)
    except Exception as e:
        debug_box.insert("end", f"Error: Is This One Of My Avatars? {file_path}: {e}\n")
        debug_box.yview("end")

def find_avatar_ids(directory, main_folder_name, debug_box):
    for root, dirs, files in os.walk(directory):
        for file_name in files:
            if file_name == "__data":
                file_path = os.path.join(root, file_name)
                process_data_file(file_path, main_folder_name, debug_box)

def process_new_folder(folder_path, debug_box):
    subfolders = next(os.walk(folder_path))[1]
    if len(subfolders) == 1:
        subfolder_path = os.path.join(folder_path, subfolders[0])
        data_file_path = os.path.join(subfolder_path, "__data")
        if os.path.exists(data_file_path):
            if not is_scanned(subfolder_path):
                debug_box.insert("end", f"{subfolder_path}\n")
                debug_box.yview("end")
                find_avatar_ids(subfolder_path, os.path.basename(subfolder_path), debug_box)
                save_scanned_directory(subfolder_path)
        else:
            debug_box.insert("end", f"{subfolder_path}\n")
            debug_box.yview("end")
    else:
        debug_box.insert("end", f"Invalid {folder_path}\n")
        debug_box.yview("end")

class NewFolderEventHandler(FileSystemEventHandler):
    def __init__(self, debug_box):
        self.debug_box = debug_box

    def on_created(self, event):
        if event.is_directory:
            process_new_folder(event.src_path, self.debug_box)

def auto_mode(debug_box):
    global auto_mode_running
    event_handler = NewFolderEventHandler(debug_box)
    observer = Observer()
    observer.schedule(event_handler, ROOT_DIR, recursive=False)
    observer.start()

    try:
        while auto_mode_running:
            time.sleep(0.1)
    except KeyboardInterrupt:
        observer.stop()
    observer.join()

def process_cache_folder_only(debug_box):
    for folder in os.listdir(ROOT_DIR):
        folder_path = os.path.join(ROOT_DIR, folder)
        if os.path.isdir(folder_path) and not is_scanned(folder):
            debug_box.insert("end", f"Cache: {folder}\n")
            debug_box.yview("end")
            find_avatar_ids(folder_path, folder, debug_box)
            save_scanned_directory(folder)


def search_ids(search_term, debug_box):
    results = []
    
    # Search in Cache
    for root, _, files in os.walk(ROOT_DIR):
        for file_name in files:
            if file_name == "__data":
                file_path = os.path.join(root, file_name)
                try:
                    temp_txt_file = file_path + ".txt"
                    shutil.copyfile(file_path, temp_txt_file)
                    with open(temp_txt_file, 'r', encoding='utf-8', errors='ignore') as f:
                        if search_term in f.read():
                            results.append(f"Found in Cache: {file_path}")
                    os.remove(temp_txt_file)
                except Exception as e:
                    debug_box.insert("end", f"Error during Cache Search: {e}\n")
                    debug_box.yview("end")
    
    for file_path in [OUTPUT_FILE, SCANNED_FILE]:
        if os.path.exists(file_path):
            with open(file_path, 'r', encoding='utf-8') as f:
                if search_term in f.read():
                    results.append(f"Found in File: {file_path}")
    
    if results:
        debug_box.insert("end", f"Search Results for '{search_term}':\n")
        for result in results:
            debug_box.insert("end", result + "\n")
    else:
        debug_box.insert("end", f"No results found for '{search_term}'.\n")
    debug_box.yview("end")

def scan_directory_background(directory, debug_box):
    def scan_thread():
        find_avatar_ids(directory, os.path.basename(directory), debug_box)
        debug_box.insert("end", f"Scan completed for {directory}\n")
        debug_box.yview("end")

    scan_thread = threading.Thread(target=scan_thread)
    scan_thread.start()

